import React, { useState } from 'react'

const SignIn = () => {
  const [account, setAccount] = ([useState])


  useEffect(() =>{
    const fetchAccount = async ()=>{
        try{
            const res = await axios.get("http://192.168.1.47:8800/sign-in")
            setAccount(res.data)
        }
        catch(err){
            console.log(err)
        }
    }
    fetchAccount()
}, [])
  return (
    <div>
      SignIn
    </div>
  )
}

export default SignIn
